import React from "react";
import '../Styles/AdminPage.css';

function AdminPage() {
    return(
        <div id='adminBody'>
            <h1 id='welcomeMsg'>Welcome back, Admin Name.</h1>
            <br/>

            <div className="bBox">
                <h1 id='actionLabel'>AVAILABLE ACTIONS</h1>
                <hr/>
            </div>
            <br/><br/>
        </div>
    )
}

export default AdminPage;
